export default function Navbar() {

  const[open,setOpen]=useState();

  function Open(){
    setOpen(!open)
  }


  return (
    <div>
      <p>We have updated our
        <a href="#">Privacy Policy</a>
        <a href='#'>Cookie Policy</a>
        </p>
        

    </div>
  )
}
